MyContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract MyContract {
    event Received(address sender, uint amount);

    receive() external payable {
        emit Received(msg.sender, msg.value);
    }

    event FallbackCalled(address semder, uint amount, bytes data);

    function getSig(address addr) external pure returns (bytes4) {
        if(addr != 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4){
            revert();
        }
        return msg.sig;
    }

    fallback() external payable {
        emit FallbackCalled(msg.sender, msg.value, msg.data);
    }
}

contract GetSig {
    function getSig() external pure returns (bytes4) {
        return msg.sig;
    }
}

